import React from 'react';
import './App.css';
import HomePage from './components/HomePage.js'; // Agregar la extensión de archivo
import Login from './components/Login.js'; // Agregar la extensión de archivo
import AdminPage from './components/AdminPage.js'; // Agregar la extensión de archivo
import UserPage from './components/UserPage.js'; // Agregar la extensión de archivo
import CountryRecipes from './components/CountryRecipes.js'; // Agregar la extensión de archivo
import RecipeDetails from './components/RecipeDetails.js'; // Agregar la extensión de archivo

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/login" element={<Login />} />
        <Route path="/admin" element={<AdminPage />} />
        <Route path="/user" element={<UserPage />} />
        <Route path="/country-recipes" element={<CountryRecipes />} />
        <Route path="/recipe-details" element={<RecipeDetails />} />
      </Routes>
    </Router>
  );
}

export default App;
